import { Button, Row } from "react-bootstrap";
import 'react-pdf/dist/esm/Page/AnnotationLayer.css';
import { Document, Page, pdfjs } from "react-pdf";
pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.js`;


const Resume = () => {
    return (
        <div className="page d-flex flex-column align-items-center">
            <Row>
                <Button className="btn btn-secondary btn-sm" href="AdamNelson_Resume2022.pdf" download>Download</Button>
            </Row>
            <Row>
                <Document className="doc " file="AdamNelson_Resume2022.pdf">
                    <Page pageNumber={1}/>
                </Document>
            </Row>
        </div>
    );
};

export default Resume;
